import React from 'react';
import { Switch, Route } from 'react-router-dom';
import './App.css';

import HomePage from './pages/homepage/HomepageComponent';
import Header from './components/header/HeaderComponent';
import ClassicalSearchPage from './pages/classical-search-page/ClassicalSearchPage';
import PopSearchPage from './pages/pop-search-page/PopSearchPage';

function App() {
  return (
    <div>
    	<Header />
  		<Switch>
    		<Route exact path='/' component={HomePage} />
    		<Route exact path='/classic_search' component={ClassicalSearchPage} />
    		<Route exact path='/pop_search' component={PopSearchPage} />
    	</Switch>
    </div>
  );
}

export default App;
